rrm_length_t
rrm_get_rrm_oam_init_config_req_len
(
    rrm_oam_init_config_req_t *p_rrm_oam_init_config_req
)
{
    rrm_length_t length = 0;

    OAM_NULL_CHECK(p_rrm_oam_init_config_req != PNULL);

    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_init_config_req->bitmask);

    /* Optional element */
    if(p_rrm_oam_init_config_req->bitmask & RRM_OAM_MODULE_INIT_CONFIG_PRESENT)
    {

    /* Get length of OCTET_STRING FIXED of IEs */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < ARRSIZE(p_rrm_oam_init_config_req->init_module_config); loop++)
        {
            length += rrm_get_rrm_oam_module_init_config_len(&p_rrm_oam_init_config_req->init_module_config[loop]);
        }
    }
    }

    /* Optional element */
    if(p_rrm_oam_init_config_req->bitmask & RRM_OAM_MODULE_HEALTH_TIMER_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_init_config_req->health_update_timer);
    }

    /* Optional element */
    if(p_rrm_oam_init_config_req->bitmask & RRM_OAM_SHM_LOGGING_INFO_PRESENT)
    {

    /* Get length of IE */
    length += rrm_get_rrm_oam_shm_log_configuration_len(&p_rrm_oam_init_config_req->rrm_shm_log_config);
    }

    /* Optional element */
    if(p_rrm_oam_init_config_req->bitmask & RRM_OAM_RIM_CONFIG_INFO_PRESENT)
    {

    /* Get length of IE */
    length += rrm_get_rrm_oam_rim_configuration_len(&p_rrm_oam_init_config_req->rrm_rim_config);
    }

    return length;
}

oam_return_et
oam_compose_rrm_oam_init_config_req
(
    U8  **pp_buffer,
    rrm_oam_init_config_req_t *p_rrm_oam_init_config_req
)
{
    OAM_NULL_CHECK(pp_buffer != PNULL);
    OAM_NULL_CHECK(*pp_buffer != PNULL);
    OAM_NULL_CHECK(p_rrm_oam_init_config_req != PNULL);

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT32(*pp_buffer, &p_rrm_oam_init_config_req->bitmask, "bitmask");
    *pp_buffer += sizeof(p_rrm_oam_init_config_req->bitmask);

    /* Optional element */
    if(p_rrm_oam_init_config_req->bitmask & RRM_OAM_MODULE_INIT_CONFIG_PRESENT)
    {

    /* Compose OCTET_STRING FIXED of IEs */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < ARRSIZE(p_rrm_oam_init_config_req->init_module_config); loop++)
        {
            if (OAM_FAILURE == oam_compose_rrm_oam_module_init_config(pp_buffer, &p_rrm_oam_init_config_req->init_module_config[loop]))
            {
                return OAM_FAILURE;
            }
        }
    }
    }

    /* Optional element */
    if(p_rrm_oam_init_config_req->bitmask & RRM_OAM_MODULE_HEALTH_TIMER_PRESENT)
    {

    /* Check for correct range [B - both higher and lower boundaries] */
    if ((p_rrm_oam_init_config_req->health_update_timer < 5) || (p_rrm_oam_init_config_req->health_update_timer > 900))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_init_config_req->health_update_timer] should be in range [5 <= %u <= 900] !", p_rrm_oam_init_config_req->health_update_timer);
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT16(*pp_buffer, &p_rrm_oam_init_config_req->health_update_timer, "health_update_timer");
    *pp_buffer += sizeof(p_rrm_oam_init_config_req->health_update_timer);
    }

    /* Optional element */
    if(p_rrm_oam_init_config_req->bitmask & RRM_OAM_SHM_LOGGING_INFO_PRESENT)
    {

    /* Compose IE */
    if (OAM_FAILURE == oam_compose_rrm_oam_shm_log_configuration(pp_buffer, &p_rrm_oam_init_config_req->rrm_shm_log_config))
    {
        return OAM_FAILURE;
    }
    }

    /* Optional element */
    if(p_rrm_oam_init_config_req->bitmask & RRM_OAM_RIM_CONFIG_INFO_PRESENT)
    {

    /* Compose IE */
    if (OAM_FAILURE == oam_compose_rrm_oam_rim_configuration(pp_buffer, &p_rrm_oam_init_config_req->rrm_rim_config))
    {
        return OAM_FAILURE;
    }
    }

    return OAM_SUCCESS;
}

/******************************************************************************
*   FUNCTION NAME: oam_rrm_send_rrm_oam_init_config_req
*
*   DESCRIPTION:
*       This function constructs and sends RRM_OAM_INIT_CONFIG_REQ message
*
*   RETURNS:
*       OAM_FAILURE     - Indicates failed message processing
*       OAM_SUCCESS     - Indicates successful message processing
*
******************************************************************************/
oam_return_et
oam_rrm_send_rrm_oam_init_config_req
(
    rrm_oam_init_config_req_t  *p_rrm_oam_init_config_req,           /* Pointer to API specific information. */
    U16                 src_module_id,  /* Source module identifier */
    U16                 dst_module_id,  /* Destination module identifier */
    U16                 transaction_id,  /* Interface transaction identifier */
    U8                  cell_index      /* cell index */
)
{
    U16 msg_length, msg_api_length;
    U8 *p_msg, *p_oam_msg;

    OAM_NULL_CHECK(p_rrm_oam_init_config_req != PNULL);

    SET_CELL_INDEX(cell_index);

    /* Get API length */
    msg_length = rrm_get_rrm_oam_init_config_req_len(p_rrm_oam_init_config_req);
    if(msg_length == OAM_FAILURE)
    {
        return OAM_FAILURE;
    }

    OAM_LOG(OAM,OAM_INFO, "Src(%u)->Dst(%u):RRM_OAM_INIT_CONFIG_REQ", src_module_id, dst_module_id);

    msg_api_length = msg_length + RRM_API_HEADER_SIZE + LOWER_LAYER_INTERFACE_HEADER_SIZE;

    /* Allocate buffer */
    p_msg = oam_msg_mem_get(msg_api_length);

    if (p_msg == PNULL)
    {
        OAM_LOG(OAM,OAM_ERROR, "Memory allocation to p_msg failed."
                " Cannot send message");
        /* Not enough memory */
        return OAM_FAILURE;
    }

    oam_memset(p_msg, 0, msg_api_length);
    p_oam_msg = p_msg;

    /* Fill CSPL header */
    oam_construct_api_header(p_oam_msg, RRM_VERSION_ID, src_module_id,
        dst_module_id, RRM_OAM_INIT_CONFIG_REQ, msg_api_length);

    /* Fill interface header */
    p_oam_msg = p_oam_msg + RRM_API_HEADER_SIZE;
    oam_construct_interface_api_header(p_oam_msg, transaction_id, src_module_id,
        dst_module_id, RRM_OAM_INIT_CONFIG_REQ, msg_length,cell_index);

    /* Fill RRM_OAM_INIT_CONFIG_REQ message */
    p_oam_msg = p_oam_msg + LOWER_LAYER_INTERFACE_HEADER_SIZE;
    if (OAM_FAILURE == oam_compose_rrm_oam_init_config_req(&p_oam_msg, p_rrm_oam_init_config_req))
    {
        oam_mem_free(p_msg,&oam_error);

        return OAM_FAILURE;
    }

    if((p_oam_msg - msg_api_length) != p_msg)
    {
        oam_mem_free(p_msg,&oam_error);

        return OAM_FAILURE;
    }
    /* Send message to */
    oam_rrm_send_message(p_msg, dst_module_id);

    return OAM_SUCCESS;
}

