static
rrm_length_t
rrm_get_rrm_oam_general_epc_params_len
(
    rrm_oam_general_epc_params_t *p_rrm_oam_general_epc_params
)
{
    rrm_length_t length = 0;

    OAM_NULL_CHECK(p_rrm_oam_general_epc_params != PNULL);

    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_general_epc_params->bitmask);
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_general_epc_params->num_valid_plmn);

    /* Check for correct range [B - both higher and lower boundaries] */
    if ((p_rrm_oam_general_epc_params->num_valid_plmn < 1) || (p_rrm_oam_general_epc_params->num_valid_plmn > RRM_OAM_MAX_NUM_PLMNS))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_general_epc_params->num_valid_plmn] should be in range [1 <= %d <= RRM_OAM_MAX_NUM_PLMNS] !", p_rrm_oam_general_epc_params->num_valid_plmn);
        return OAM_FAILURE;
    }

    /* Get length of OCTET_STRING VARIABLE of IEs */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < p_rrm_oam_general_epc_params->num_valid_plmn; loop++)
        {
            length += rrm_get_rrm_oam_plmn_access_info_len(&p_rrm_oam_general_epc_params->plmn_list[loop]);
        }
    }
    /* Get length of OCTET_STRING FIXED of basic type elements */
    length += sizeof(p_rrm_oam_general_epc_params->tac);

    /* Optional element */
    if(p_rrm_oam_general_epc_params->bitmask & RRM_OAM_EMERGENCY_AREA_ID_PRESENT)
    {
    /* Get length of OCTET_STRING FIXED of basic type elements */
    length += sizeof(p_rrm_oam_general_epc_params->eaid);
    }

    return length;
}

