    /* Check for correct range [B - both higher and lower boundaries] */
    if ((p_rrm_oam_general_epc_params->num_valid_plmn < 1) || (p_rrm_oam_general_epc_params->num_valid_plmn > RRM_OAM_MAX_NUM_PLMNS))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_general_epc_params->num_valid_plmn] should be in range [1 <= %u <= RRM_OAM_MAX_NUM_PLMNS] !", p_rrm_oam_general_epc_params->num_valid_plmn);
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
