static
rrm_length_t
rrm_get_rrm_oam_access_mgmt_params_len
(
    rrm_oam_access_mgmt_params_t *p_rrm_oam_access_mgmt_params
)
{
    rrm_length_t length = 0;

    OAM_NULL_CHECK(p_rrm_oam_access_mgmt_params != PNULL);

    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_access_mgmt_params->bitmask);
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_access_mgmt_params->access_mode);
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_access_mgmt_params->max_csg_members);
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_access_mgmt_params->max_non_csg_members);

    /* Optional element */
    if(p_rrm_oam_access_mgmt_params->bitmask & RRM_OAM_CSG_ID_PRESENT)
    {
    /* Get length of OCTET_STRING FIXED of basic type elements */
    length += sizeof(p_rrm_oam_access_mgmt_params->csg_id);
    }
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_access_mgmt_params->hnb_name_size);
    /* Get length of OCTET_STRING VARIABLE of basic type elements */
    length += (p_rrm_oam_access_mgmt_params->hnb_name_size * sizeof(p_rrm_oam_access_mgmt_params->hnb_name[0]));

    return length;
}

static
oam_return_et
oam_compose_rrm_oam_access_mgmt_params
(
    U8  **pp_buffer,
    rrm_oam_access_mgmt_params_t *p_rrm_oam_access_mgmt_params
)
{
    OAM_NULL_CHECK(pp_buffer != PNULL);
    OAM_NULL_CHECK(*pp_buffer != PNULL);
    OAM_NULL_CHECK(p_rrm_oam_access_mgmt_params != PNULL);

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT32(*pp_buffer, &p_rrm_oam_access_mgmt_params->bitmask, "bitmask");
    *pp_buffer += sizeof(p_rrm_oam_access_mgmt_params->bitmask);

    /* Check for correct range [H - higher boundary] */
    if ((p_rrm_oam_access_mgmt_params->access_mode > 2))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_access_mgmt_params->access_mode] should be in range [%u <= 2] !", p_rrm_oam_access_mgmt_params->access_mode);
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT32(*pp_buffer, &p_rrm_oam_access_mgmt_params->access_mode, "access_mode");
    *pp_buffer += sizeof(p_rrm_oam_access_mgmt_params->access_mode);

    /* Compose parameter of basic type */
    OAM_CP_PACK_SINT16(*pp_buffer, &p_rrm_oam_access_mgmt_params->max_csg_members, "max_csg_members");
    *pp_buffer += sizeof(p_rrm_oam_access_mgmt_params->max_csg_members);

    /* Compose parameter of basic type */
    OAM_CP_PACK_SINT16(*pp_buffer, &p_rrm_oam_access_mgmt_params->max_non_csg_members, "max_non_csg_members");
    *pp_buffer += sizeof(p_rrm_oam_access_mgmt_params->max_non_csg_members);

    /* Optional element */
    if(p_rrm_oam_access_mgmt_params->bitmask & RRM_OAM_CSG_ID_PRESENT)
    {

    /* Compose OCTET_STRING FIXED of basic type elements */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < ARRSIZE(p_rrm_oam_access_mgmt_params->csg_id); loop++)
        {
            OAM_CP_PACK_UINT8(*pp_buffer, &p_rrm_oam_access_mgmt_params->csg_id[loop], "csg_id[]");
            *pp_buffer += sizeof(U8);
        }
    }
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT8(*pp_buffer, &p_rrm_oam_access_mgmt_params->hnb_name_size, "hnb_name_size");
    *pp_buffer += sizeof(p_rrm_oam_access_mgmt_params->hnb_name_size);

    /* Compose OCTET_STRING VARIABLE of basic type elements */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < p_rrm_oam_access_mgmt_params->hnb_name_size; loop++)
        {
            OAM_CP_PACK_UINT8(*pp_buffer, &p_rrm_oam_access_mgmt_params->hnb_name[loop], "hnb_name[]");
            *pp_buffer += sizeof(U8);
        }
    }

    return OAM_SUCCESS;
}

