rrm_length_t
rrm_get_rrm_oam_load_config_req_len
(
    rrm_oam_load_config_req_t *p_rrm_oam_load_config_req
)
{
    rrm_length_t length = 0;

    OAM_NULL_CHECK(p_rrm_oam_load_config_req != PNULL);

    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_load_config_req->bitmask);

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_NCL_LOAD_IND_INTRVL_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_load_config_req->ncl_load_ind_intrvl);
    }

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_LOAD_RPT_INTRVL_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_load_config_req->load_rpt_intrvl);
    }
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_load_config_req->num_enb_cells);

    /* Check for correct range [H - higher boundary] */
    if ((p_rrm_oam_load_config_req->num_enb_cells > RRM_MAX_NUM_CELLS))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_load_config_req->num_enb_cells] should be in range [%d <= RRM_MAX_NUM_CELLS] !", p_rrm_oam_load_config_req->num_enb_cells);
        return OAM_FAILURE;
    }

    /* Get length of OCTET_STRING VARIABLE of IEs */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < p_rrm_oam_load_config_req->num_enb_cells; loop++)
        {
            length += rrm_get_rrm_oam_serving_enb_cell_info_len(&p_rrm_oam_load_config_req->serv_enb_cell_info[loop]);
        }
    }

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_LOAD_CHK_PRDCTY_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_load_config_req->load_chk_periodicity);
    }

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_HIGH_ACT_RPT_LMT_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_load_config_req->high_actn_repeat_lmt);
    }

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_TNL_LOAD_SUPPORT_FLAG_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_load_config_req->tnl_load_support_flag);
    }

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_HW_LOAD_SUPPORT_FLAG_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_load_config_req->hw_load_support_flag);
    }

    return length;
}

oam_return_et
oam_compose_rrm_oam_load_config_req
(
    U8  **pp_buffer,
    rrm_oam_load_config_req_t *p_rrm_oam_load_config_req
)
{
    OAM_NULL_CHECK(pp_buffer != PNULL);
    OAM_NULL_CHECK(*pp_buffer != PNULL);
    OAM_NULL_CHECK(p_rrm_oam_load_config_req != PNULL);

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT32(*pp_buffer, &p_rrm_oam_load_config_req->bitmask, "bitmask");
    *pp_buffer += sizeof(p_rrm_oam_load_config_req->bitmask);

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_NCL_LOAD_IND_INTRVL_PRESENT)
    {

    /* Check for correct range [H - higher boundary] */
    if ((p_rrm_oam_load_config_req->ncl_load_ind_intrvl > 10))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_load_config_req->ncl_load_ind_intrvl] should be in range [%u <= 10] !", p_rrm_oam_load_config_req->ncl_load_ind_intrvl);
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT8(*pp_buffer, &p_rrm_oam_load_config_req->ncl_load_ind_intrvl, "ncl_load_ind_intrvl");
    *pp_buffer += sizeof(p_rrm_oam_load_config_req->ncl_load_ind_intrvl);
    }

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_LOAD_RPT_INTRVL_PRESENT)
    {

    /* Check for correct range [H - higher boundary] */
    if ((p_rrm_oam_load_config_req->load_rpt_intrvl > 300))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_load_config_req->load_rpt_intrvl] should be in range [%u <= 300] !", p_rrm_oam_load_config_req->load_rpt_intrvl);
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT16(*pp_buffer, &p_rrm_oam_load_config_req->load_rpt_intrvl, "load_rpt_intrvl");
    *pp_buffer += sizeof(p_rrm_oam_load_config_req->load_rpt_intrvl);
    }

    /* Check for correct range [H - higher boundary] */
    if ((p_rrm_oam_load_config_req->num_enb_cells > RRM_MAX_NUM_CELLS))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_load_config_req->num_enb_cells] should be in range [%u <= RRM_MAX_NUM_CELLS] !", p_rrm_oam_load_config_req->num_enb_cells);
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT16(*pp_buffer, &p_rrm_oam_load_config_req->num_enb_cells, "num_enb_cells");
    *pp_buffer += sizeof(p_rrm_oam_load_config_req->num_enb_cells);

    /* Compose OCTET_STRING VARIABLE of IEs */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < p_rrm_oam_load_config_req->num_enb_cells; loop++)
        {
            if (OAM_FAILURE == oam_compose_rrm_oam_serving_enb_cell_info(pp_buffer, &p_rrm_oam_load_config_req->serv_enb_cell_info[loop]))
            {
                return OAM_FAILURE;
            }
        }
    }

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_LOAD_CHK_PRDCTY_PRESENT)
    {

    /* Check for correct range [B - both higher and lower boundaries] */
    if ((p_rrm_oam_load_config_req->load_chk_periodicity < 5) || (p_rrm_oam_load_config_req->load_chk_periodicity > 600))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_load_config_req->load_chk_periodicity] should be in range [5 <= %u <= 600] !", p_rrm_oam_load_config_req->load_chk_periodicity);
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT16(*pp_buffer, &p_rrm_oam_load_config_req->load_chk_periodicity, "load_chk_periodicity");
    *pp_buffer += sizeof(p_rrm_oam_load_config_req->load_chk_periodicity);
    }

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_HIGH_ACT_RPT_LMT_PRESENT)
    {

    /* Check for correct range [B - both higher and lower boundaries] */
    if ((p_rrm_oam_load_config_req->high_actn_repeat_lmt < 5) || (p_rrm_oam_load_config_req->high_actn_repeat_lmt > 10))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_load_config_req->high_actn_repeat_lmt] should be in range [5 <= %u <= 10] !", p_rrm_oam_load_config_req->high_actn_repeat_lmt);
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT8(*pp_buffer, &p_rrm_oam_load_config_req->high_actn_repeat_lmt, "high_actn_repeat_lmt");
    *pp_buffer += sizeof(p_rrm_oam_load_config_req->high_actn_repeat_lmt);
    }

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_TNL_LOAD_SUPPORT_FLAG_PRESENT)
    {

    /* Check for correct range [H - higher boundary] */
    if ((p_rrm_oam_load_config_req->tnl_load_support_flag > 1))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_load_config_req->tnl_load_support_flag] should be in range [%u <= 1] !", p_rrm_oam_load_config_req->tnl_load_support_flag);
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT8(*pp_buffer, &p_rrm_oam_load_config_req->tnl_load_support_flag, "tnl_load_support_flag");
    *pp_buffer += sizeof(p_rrm_oam_load_config_req->tnl_load_support_flag);
    }

    /* Optional element */
    if(p_rrm_oam_load_config_req->bitmask & RRM_OAM_HW_LOAD_SUPPORT_FLAG_PRESENT)
    {

    /* Check for correct range [H - higher boundary] */
    if ((p_rrm_oam_load_config_req->hw_load_support_flag > 1))
    {
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_load_config_req->hw_load_support_flag] should be in range [%u <= 1] !", p_rrm_oam_load_config_req->hw_load_support_flag);
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT8(*pp_buffer, &p_rrm_oam_load_config_req->hw_load_support_flag, "hw_load_support_flag");
    *pp_buffer += sizeof(p_rrm_oam_load_config_req->hw_load_support_flag);
    }

    return OAM_SUCCESS;
}

/******************************************************************************
*   FUNCTION NAME: oam_rrm_send_rrm_oam_load_config_req
*
*   DESCRIPTION:
*       This function constructs and sends RRM_OAM_LOAD_CONFIG_REQ message
*
*   RETURNS:
*       OAM_FAILURE     - Indicates failed message processing
*       OAM_SUCCESS     - Indicates successful message processing
*
******************************************************************************/
oam_return_et
oam_rrm_send_rrm_oam_load_config_req
(
    rrm_oam_load_config_req_t  *p_rrm_oam_load_config_req,           /* Pointer to API specific information. */
    U16                 src_module_id,  /* Source module identifier */
    U16                 dst_module_id,  /* Destination module identifier */
    U16                 transaction_id,  /* Interface transaction identifier */
    U8                  cell_index      /* cell index */
)
{
    U16 msg_length, msg_api_length;
    U8 *p_msg, *p_oam_msg;

    OAM_NULL_CHECK(p_rrm_oam_load_config_req != PNULL);

    SET_CELL_INDEX(cell_index);

    /* Get API length */
    msg_length = rrm_get_rrm_oam_load_config_req_len(p_rrm_oam_load_config_req);
    if(msg_length == OAM_FAILURE)
    {
        return OAM_FAILURE;
    }

    OAM_LOG(OAM,OAM_INFO, "Src(%u)->Dst(%u):RRM_OAM_LOAD_CONFIG_REQ", src_module_id, dst_module_id);

    msg_api_length = msg_length + RRM_API_HEADER_SIZE + LOWER_LAYER_INTERFACE_HEADER_SIZE;

    /* Allocate buffer */
    p_msg = oam_msg_mem_get(msg_api_length);

    if (p_msg == PNULL)
    {
        OAM_LOG(OAM,OAM_ERROR, "Memory allocation to p_msg failed."
                " Cannot send message");
        /* Not enough memory */
        return OAM_FAILURE;
    }

    oam_memset(p_msg, 0, msg_api_length);
    p_oam_msg = p_msg;

    /* Fill CSPL header */
    oam_construct_api_header(p_oam_msg, RRM_VERSION_ID, src_module_id,
        dst_module_id, RRM_OAM_LOAD_CONFIG_REQ, msg_api_length);

    /* Fill interface header */
    p_oam_msg = p_oam_msg + RRM_API_HEADER_SIZE;
    oam_construct_interface_api_header(p_oam_msg, transaction_id, src_module_id,
        dst_module_id, RRM_OAM_LOAD_CONFIG_REQ, msg_length,cell_index);

    /* Fill RRM_OAM_LOAD_CONFIG_REQ message */
    p_oam_msg = p_oam_msg + LOWER_LAYER_INTERFACE_HEADER_SIZE;
    if (OAM_FAILURE == oam_compose_rrm_oam_load_config_req(&p_oam_msg, p_rrm_oam_load_config_req))
    {
        oam_mem_free(p_msg,&oam_error);

        return OAM_FAILURE;
    }

    if((p_oam_msg - msg_api_length) != p_msg)
    {
        oam_mem_free(p_msg,&oam_error);

        return OAM_FAILURE;
    }
    /* Send message to */
    oam_rrm_send_message(p_msg, dst_module_id);

    return OAM_SUCCESS;
}

