/******************************************************************************
*   FUNCTION NAME: oam_rrm_send_rrm_oam_cell_ecn_capacity_enhance_req
*
*   DESCRIPTION:
*       This function constructs and sends RRM_OAM_CELL_ECN_CAPACITY_ENHANCE_REQ message
*
*   RETURNS:
*       OAM_FAILURE     - Indicates failed message processing
*       OAM_SUCCESS     - Indicates successful message processing
*
******************************************************************************/
oam_return_et
oam_rrm_send_rrm_oam_cell_ecn_capacity_enhance_req
(
    rrm_oam_cell_ecn_capacity_enhance_req_t  *p_rrm_oam_cell_ecn_capacity_enhance_req,           /* Pointer to API specific information. */
    U16                 src_module_id,  /* Source module identifier */
    U16                 dst_module_id,  /* Destination module identifier */
    U16                 transaction_id,  /* Interface transaction identifier */
    U8                  cell_index      /* cell index */
)
{
    U16 msg_length, msg_api_length;
    U8 *p_msg, *p_oam_msg;

    OAM_NULL_CHECK(p_rrm_oam_cell_ecn_capacity_enhance_req != PNULL);

    SET_CELL_INDEX(cell_index);

    /* Get API length */
    msg_length = rrm_get_rrm_oam_cell_ecn_capacity_enhance_req_len(p_rrm_oam_cell_ecn_capacity_enhance_req);
    if(msg_length == OAM_FAILURE)
    {
        return OAM_FAILURE;
    }

    OAM_LOG(OAM,OAM_INFO, "Src(%u)->Dst(%u):RRM_OAM_CELL_ECN_CAPACITY_ENHANCE_REQ", src_module_id, dst_module_id);

    msg_api_length = msg_length + RRM_API_HEADER_SIZE + LOWER_LAYER_INTERFACE_HEADER_SIZE;

    /* Allocate buffer */
    p_msg = oam_msg_mem_get(msg_api_length);

    if (p_msg == PNULL)
    {
        OAM_LOG(OAM,OAM_ERROR, "Memory allocation to p_msg failed."
                " Cannot send message");
        /* Not enough memory */
        return OAM_FAILURE;
    }

    oam_memset(p_msg, 0, msg_api_length);
    p_oam_msg = p_msg;

    /* Fill CSPL header */
    oam_construct_api_header(p_oam_msg, RRM_VERSION_ID, src_module_id,
        dst_module_id, RRM_OAM_CELL_ECN_CAPACITY_ENHANCE_REQ, msg_api_length);

    /* Fill interface header */
    p_oam_msg = p_oam_msg + RRM_API_HEADER_SIZE;
    oam_construct_interface_api_header(p_oam_msg, transaction_id, src_module_id,
        dst_module_id, RRM_OAM_CELL_ECN_CAPACITY_ENHANCE_REQ, msg_length,cell_index);

    /* Fill RRM_OAM_CELL_ECN_CAPACITY_ENHANCE_REQ message */
    p_oam_msg = p_oam_msg + LOWER_LAYER_INTERFACE_HEADER_SIZE;
    if (OAM_FAILURE == oam_compose_rrm_oam_cell_ecn_capacity_enhance_req(&p_oam_msg, p_rrm_oam_cell_ecn_capacity_enhance_req))
    {
        oam_mem_free(p_msg,&oam_error);

        return OAM_FAILURE;
    }

    if((p_oam_msg - msg_api_length) != p_msg)
    {
        oam_mem_free(p_msg,&oam_error);

        return OAM_FAILURE;
    }
    /* Send message to */
    oam_rrm_send_message(p_msg, dst_module_id);

    return OAM_SUCCESS;
}

