rrm_length_t
rrm_get_cell_config_rrm_oam_cell_config_req_len
(
    rrm_oam_cell_config_req_t *p_rrm_oam_cell_config_req
)
{
    rrm_length_t length = 0;

    OAM_NULL_CHECK(p_rrm_oam_cell_config_req != PNULL);

    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_cell_config_req->bitmask);

    /* Get length of IE */
    length += rrm_get_cell_config_rrm_oam_cell_info_len(&p_rrm_oam_cell_config_req->global_cell_info);

    /* Get length of IE */
    length += rrm_get_cell_config_rrm_oam_ran_len(&p_rrm_oam_cell_config_req->ran_info);

    /* Get length of IE */
    length += rrm_get_cell_config_rrm_oam_epc_len(&p_rrm_oam_cell_config_req->epc_info);

    /* Get length of IE */
    length += rrm_get_cell_config_rrm_oam_operator_info_len(&p_rrm_oam_cell_config_req->operator_info);

    /* Optional element */
    if(p_rrm_oam_cell_config_req->bitmask & RRM_OAM_ACCESS_MGMT_PARAMS_PRESENT)
    {

    /* Get length of IE */
    length += rrm_get_cell_config_rrm_oam_access_mgmt_params_len(&p_rrm_oam_cell_config_req->access_mgmt_params);
    }
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_cell_config_req->immediate_start_needed);

    /* Get length of IE */
    length += rrm_get_cell_config_rrm_oam_lower_layer_comm_info_len(&p_rrm_oam_cell_config_req->l2_comm_info_params);

    return length;
}

oam_return_et
oam_compose_cell_config_rrm_oam_cell_config_req
(
    U8  **pp_buffer,
    rrm_oam_cell_config_req_t *p_rrm_oam_cell_config_req
)
{
    OAM_NULL_CHECK(pp_buffer != PNULL);
    OAM_NULL_CHECK(*pp_buffer != PNULL);
    OAM_NULL_CHECK(p_rrm_oam_cell_config_req != PNULL);

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT32(*pp_buffer, &p_rrm_oam_cell_config_req->bitmask, "bitmask");
    *pp_buffer += sizeof(p_rrm_oam_cell_config_req->bitmask);

    /* Compose IE */
    if (OAM_FAILURE == oam_compose_cell_config_rrm_oam_cell_info(pp_buffer, &p_rrm_oam_cell_config_req->global_cell_info))
    {
        return OAM_FAILURE;
    }

    /* Compose IE */
    if (OAM_FAILURE == oam_compose_cell_config_rrm_oam_ran(pp_buffer, &p_rrm_oam_cell_config_req->ran_info))
    {
        return OAM_FAILURE;
    }

    /* Compose IE */
    if (OAM_FAILURE == oam_compose_cell_config_rrm_oam_epc(pp_buffer, &p_rrm_oam_cell_config_req->epc_info))
    {
        return OAM_FAILURE;
    }

    /* Compose IE */
    if (OAM_FAILURE == oam_compose_cell_config_rrm_oam_operator_info(pp_buffer, &p_rrm_oam_cell_config_req->operator_info))
    {
        return OAM_FAILURE;
    }

    /* Optional element */
    if(p_rrm_oam_cell_config_req->bitmask & RRM_OAM_ACCESS_MGMT_PARAMS_PRESENT)
    {

    /* Compose IE */
    if (OAM_FAILURE == oam_compose_cell_config_rrm_oam_access_mgmt_params(pp_buffer, &p_rrm_oam_cell_config_req->access_mgmt_params))
    {
        return OAM_FAILURE;
    }
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT32(*pp_buffer, &p_rrm_oam_cell_config_req->immediate_start_needed, "immediate_start_needed");
    *pp_buffer += sizeof(p_rrm_oam_cell_config_req->immediate_start_needed);

    /* Compose IE */
    if (OAM_FAILURE == oam_compose_cell_config_rrm_oam_lower_layer_comm_info(pp_buffer, &p_rrm_oam_cell_config_req->l2_comm_info_params))
    {
        return OAM_FAILURE;
    }

    return OAM_SUCCESS;
}

/******************************************************************************
*   FUNCTION NAME: oam_rrm_send_rrm_oam_cell_config_req
*
*   DESCRIPTION:
*       This function constructs and sends RRM_OAM_CELL_CONFIG_REQ message
*
*   RETURNS:
*       OAM_FAILURE     - Indicates failed message processing
*       OAM_SUCCESS     - Indicates successful message processing
*
******************************************************************************/
oam_return_et
oam_rrm_send_rrm_oam_cell_config_req
(
    rrm_oam_cell_config_req_t  *p_rrm_oam_cell_config_req,           /* Pointer to API specific information. */
    U16                 src_module_id,  /* Source module identifier */
    U16                 dst_module_id,  /* Destination module identifier */
    U16                 transaction_id,  /* Interface transaction identifier */
    U8                  cell_index      /* cell index */
)
{
    U16 msg_length, msg_api_length;
    U8 *p_msg, *p_oam_msg;

    OAM_NULL_CHECK(p_rrm_oam_cell_config_req != PNULL);

    SET_CELL_INDEX(cell_index);

    /* Get API length */
    msg_length = rrm_get_cell_config_rrm_oam_cell_config_req_len(p_rrm_oam_cell_config_req);
	if(msg_length == OAM_FAILURE)
	{
	return OAM_FAILURE;
	}
#ifdef OAM_DEBUG
    OAM_LOG(OAM,OAM_INFO, "Src(%u)->Dst(%u):RRM_OAM_CELL_CONFIG_REQ", src_module_id, dst_module_id);
#endif
    msg_api_length = msg_length + RRM_API_HEADER_SIZE + LOWER_LAYER_INTERFACE_HEADER_SIZE;

    /* Allocate buffer */
    p_msg = oam_msg_mem_get(msg_api_length);

    if (p_msg == PNULL)
    {
        OAM_LOG(OAM,OAM_ERROR, "Memory allocation to p_msg failed."
                " Cannot send message");
        /* Not enough memory */
        return OAM_FAILURE;
    }

    oam_memset(p_msg, 0, msg_api_length);
    p_oam_msg = p_msg;

    /* Fill CSPL header */
    oam_construct_api_header(p_oam_msg, RRM_VERSION_ID, src_module_id,
        dst_module_id, RRM_OAM_CELL_CONFIG_REQ, msg_api_length);

    /* Fill interface header */
    p_oam_msg = p_oam_msg + RRM_API_HEADER_SIZE;
    oam_construct_interface_api_header(p_oam_msg, transaction_id, src_module_id,
        dst_module_id, RRM_OAM_CELL_CONFIG_REQ, msg_length,cell_index);

    /* Fill RRM_OAM_CELL_CONFIG_REQ message */
    p_oam_msg = p_oam_msg + LOWER_LAYER_INTERFACE_HEADER_SIZE;
    if (OAM_FAILURE == oam_compose_cell_config_rrm_oam_cell_config_req(&p_oam_msg, p_rrm_oam_cell_config_req))
    {
        oam_mem_free(p_msg,&oam_error);

        return OAM_FAILURE;
    }

    if((p_oam_msg - msg_api_length) != p_msg)
    {
        oam_mem_free(p_msg,&oam_error);

        return OAM_FAILURE;
    }
    /* Send message to */
    oam_rrm_send_message(p_msg, dst_module_id);

    return OAM_SUCCESS;
}

static
rrm_length_t
rrm_get_cell_config_rrm_oam_cell_plmn_info_len
(
    rrm_oam_cell_plmn_info_t *p_rrm_oam_cell_plmn_info
)
{
    rrm_length_t length = 0;

    OAM_NULL_CHECK(p_rrm_oam_cell_plmn_info != PNULL);

    /* Get length of OCTET_STRING FIXED of basic type elements */
    length += sizeof(p_rrm_oam_cell_plmn_info->mcc);
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_cell_plmn_info->num_mnc_digit);
    /* Get length of OCTET_STRING VARIABLE of basic type elements */
    length += (p_rrm_oam_cell_plmn_info->num_mnc_digit * sizeof(p_rrm_oam_cell_plmn_info->mnc[0]));

    return length;
}

static
oam_return_et
oam_compose_cell_config_rrm_oam_cell_plmn_info
(
    U8  **pp_buffer,
    rrm_oam_cell_plmn_info_t *p_rrm_oam_cell_plmn_info
)
{
    OAM_NULL_CHECK(pp_buffer != PNULL);
    OAM_NULL_CHECK(*pp_buffer != PNULL);
    OAM_NULL_CHECK(p_rrm_oam_cell_plmn_info != PNULL);

    /* Compose OCTET_STRING FIXED of basic type elements */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < ARRSIZE(p_rrm_oam_cell_plmn_info->mcc); loop++)
        {
            OAM_CP_PACK_UINT8(*pp_buffer, &p_rrm_oam_cell_plmn_info->mcc[loop], "mcc[]");
            *pp_buffer += sizeof(U8);
        }
    }

    /* Check for correct range [B - both higher and lower boundaries] */
    if ((p_rrm_oam_cell_plmn_info->num_mnc_digit < 2) || (p_rrm_oam_cell_plmn_info->num_mnc_digit > 3))
    {
    #ifdef OAM_DEBUG
            OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_cell_plmn_info->num_mnc_digit] should be in range [2 <= %u <= 3] !", p_rrm_oam_cell_plmn_info->num_mnc_digit);
    #endif
        return OAM_FAILURE;
    }

    /* Compose parameter of basic type */
    OAM_CP_PACK_UINT8(*pp_buffer, &p_rrm_oam_cell_plmn_info->num_mnc_digit, "num_mnc_digit");
    *pp_buffer += sizeof(p_rrm_oam_cell_plmn_info->num_mnc_digit);

    /* Compose OCTET_STRING VARIABLE of basic type elements */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < p_rrm_oam_cell_plmn_info->num_mnc_digit; loop++)
        {
            OAM_CP_PACK_UINT8(*pp_buffer, &p_rrm_oam_cell_plmn_info->mnc[loop], "mnc[]");
            *pp_buffer += sizeof(U8);
        }
    }

    return OAM_SUCCESS;
}

static
rrm_length_t
rrm_get_cell_config_rrm_oam_eutran_global_cell_id_len
(
    rrm_oam_eutran_global_cell_id_t *p_rrm_oam_eutran_global_cell_id
)
{
    rrm_length_t length = 0;

    OAM_NULL_CHECK(p_rrm_oam_eutran_global_cell_id != PNULL);


    /* Get length of IE */
    length += rrm_get_cell_config_rrm_oam_cell_plmn_info_len(&p_rrm_oam_eutran_global_cell_id->primary_plmn_id);
    /* Get length of OCTET_STRING FIXED of basic type elements */
    length += sizeof(p_rrm_oam_eutran_global_cell_id->cell_identity);

    return length;
}

