    length += sizeof(p_rrm_oam_cdma2000_freq_cells->arfcn);
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_cdma2000_freq_cells->pn_offset);
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_cdma2000_freq_cells->type);
