static
rrm_length_t
rrm_get_cell_config_rrm_oam_epc_params_len
(
    rrm_oam_epc_params_t *p_rrm_oam_epc_params
)
{
    rrm_length_t length = 0;

    OAM_NULL_CHECK(p_rrm_oam_epc_params != PNULL);

    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_epc_params->bitmask);

    /* Get length of IE */
    length += rrm_get_cell_config_rrm_oam_general_epc_params_len(&p_rrm_oam_epc_params->general_epc_params);
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_epc_params->num_valid_qos_profiles);

    /* Check for correct range [H - higher boundary] */
    if ((p_rrm_oam_epc_params->num_valid_qos_profiles > RRM_OAM_MAX_NUM_QCI_CLASSES))
    {
#ifdef OAM_DEBUG
        OAM_LOG(OAM,OAM_WARNING, "Parameter [p_rrm_oam_epc_params->num_valid_qos_profiles] should be in range [%d <= RRM_OAM_MAX_NUM_QCI_CLASSES] !", p_rrm_oam_epc_params->num_valid_qos_profiles);
#endif
        return OAM_FAILURE;
    }

    /* Get length of OCTET_STRING VARIABLE of IEs */
    {
        rrm_counter_t loop;
        for (loop = 0; loop < p_rrm_oam_epc_params->num_valid_qos_profiles; loop++)
        {
            length += rrm_get_cell_config_rrm_oam_qos_config_params_len(&p_rrm_oam_epc_params->qos_config_params[loop]);
        }
    }

    /* Optional element */
    if(p_rrm_oam_epc_params->bitmask & RRM_OAM_EMERGENCY_ERAB_ARP_PRESENT)
    {
    /* Get length of parameter of basic type */
    length += sizeof(p_rrm_oam_epc_params->emergency_erab_arp);
    }

    return length;
}

